import './App.css';
import axios from 'axios';
import state from 'react';

const api = axios.create({
  baseURL: "https://run.mocky.io/v3/9ddcc153-4ecb-4420-9c62-0e0a204e25b8",
});

function App() {
  state = {
    courses: [],
  };
  api.get('/').then((res) => {
    console.log(res.data);
    this.setState({ courses: res.data });
  });
  return (this.state.courses.map((courses) => (
    <h2 key={courses.id}>{courses.title}</h2>
  ))
  )
}

export default App;
